  //     console.log(response)
  //   }
  const finDelLogin = (mensajesDeRespuesta) => {
    console.log(mensajesDeRespuesta);
  };

  const login = async () => {
    const mensajeEnviar = "/LogInn/" + username + "/" + password + "/";
    peticionAlServidor(1, mensajeEnviar, finDelLogin);
  };

  return (
    <LoginPageContainer>
      <FormContainer>
        <Logicon/>
        <Input2 type="text"
          placeholder={"Insert Username"}
          onChange={({ target }) => setUsername(target.value)} />

        <Input1 type="password"
          placeholder={"Insert Password"}
          onChange={({ target }) => setPassword(target.value)} />

        {lerror ? (<ErrorMsg> Error de autenticaci√≥n</ErrorMsg>) : (<div></div>)} 

        <Button onClick={login}>Login</Button>
      </FormContainer>
    </LoginPageContainer>
  );
};

export default Login;
